import logo from './logo.svg';
import './App.css';

function App() {
  const name = 1;
  function fullName(firstName, lastName){
    return `${firstName} ${lastName}`
  }
  return (
    <div className="App">
    <div className="duong" id></div>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>{name === 1?"Le Pham Trung Duong":"DuongLe"}</h1>
        <h2>{fullName}</h2>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
